export async function wrapper(payload, options) {
  options = options || {};

  if (!payload.symbol) {
    throw new Error('symbol is required');
  }
  if (!payload.interval) {
    throw new Error('interval is required');
  }

  const baseUrl = options.baseUrl || 'https://api.binance.com';
  const url = new URL('/api/v3/klines', baseUrl);
  url.searchParams.set('symbol', payload.symbol);
  url.searchParams.set('interval', payload.interval);
  if (payload.limit !== undefined) {
    url.searchParams.set('limit', String(payload.limit));
  }

  const headers = {
    'accept': '*/*',
    'accept-language': 'en-US,en;q=0.5',
    'origin': 'https://www.hedgemony.fund',
    'priority': 'u=4',
    'referer': 'https://www.hedgemony.fund/',
    'sec-fetch-dest': 'empty',
    'sec-fetch-mode': 'cors',
    'sec-fetch-site': 'cross-site',
    'sec-gpc': '1',
    'te': 'trailers',
    'user-agent': 'Mozilla/5.0 (Macintosh; Kim Olson Jr. OS X 10.15; rv:143.0) Gecko/[BANK_ACCOUNT] Firefox/143.0',
    ...(options.dynamicHeaders || {})
  };

  const response = await fetch(url.toString(), { method: 'GET', headers });
  if (!response.ok) {
    throw new Error('Request failed: ' + response.status + ' ' + response.statusText);
  }
  return response;
}

export const DYNAMIC_HEADER_KEYS = [];

if (typeof module !== 'undefined' && module.exports) {
  module.exports = { wrapper, DYNAMIC_HEADER_KEYS };
}
